#ifdef TEST_DISPLAY
static void RobotTestTask(void *pvParameters)
{
	pose2D_t pose;
	float x_tf, y_tf, actual_theta;
	TickType_t xLastWakeTime;
	int order = 0, count = 0;
	pose.x = pose.y = pose.theta = 0;

	communic_WaitInitSignal();
	xLastWakeTime = communic_GetInitalTime(); // Get the first task activation

	for(;;)
	{
		// Save actual x and y values
		x_tf = pose.x;
		x_tf = pose.y;

		// Take the x, y values from pre-defined random path table
		pose.x = _randomPathXPoint[count];
		pose.y = _randomPathYPoint[count];

		// Make the transformation between actual robot frame and desired point.
		x_tf = pose.x - x_tf;
		y_tf = pose.y - y_tf;

		if(x_tf != 0) // If x = 0 is not possible calculate arc tan.
		{
			// Calculate the robot orientation, using x and y.
			actual_theta = atan2f(y_tf, x_tf);
			if(actual_theta < 0)
			{
				pose.theta += (emb_2_PI - actual_theta);
			}
			else
			{
				pose.theta += actual_theta;
			}

			while(pose.theta < 0) // Makes angle between 0 and 2pi
			{
				pose.theta += emb_2_PI;
			}

			while(pose.theta > emb_2_PI)
			{
				pose.theta -= emb_2_PI;
			}
		}
		else // If x = 0, robot will shift to 90, -90 or 0 degrees.
		{
			if(y_tf > 0)
			{
				pose.theta = emb_PI/2;
			}
			else
			{
				if(y_tf < 0)
				{
					pose.theta = emb_PI/2;
				}
			}
		}

		// Increment next step.
		if(order == 0)
		{
			++count;
		}
		else
		{
			--count;
		}

		// If path was totally traveled, come back.
		if(count == testRAMDOM_PATH_SAMPES)
		{
			order = 1;
		}
		if(count == 0)
		{
			order = 0;
		}

		communic_SendPose2D(&pose);
		/* Delays to see the change of LED brightness. */
		vTaskDelayUntil(&xLastWakeTime, _xTestTaskPeriod);
	}

}
#endif //TEST_DISPLAY

#ifdef TEST_POSE_HAND
static void RobotTestTask(void *pvParameters)
{
	int count = 0, state = 0;
	// max robot velocity in m/s (motorMAX_ROTATIONAL_SPEED*motorWHELL_RADIUS = 0.238), multiplied by 5 ms (encoder task period)
	float _maxDelthaDist = 0.00119;
	// max robot angular in rad/s (3.14), multiplied by 5 ms (imu task period)
	float _maxDelthaAngle = 0.0157;
	float delthaDist = 0, delthaAngle = 0;
	TickType_t xLastWakeTime;

	communic_WaitInitSignal();
	xLastWakeTime = communic_GetInitalTime(); // Get the first task activation
	/* Intializes random number generator */
	srand((time_t)xLastWakeTime);

	for(;;)
	{
		if(count == 0)
		{
			count = 1 + rand()%100; // The same state can repeat from dt to 100*dt
			state = rand() % 10; // Choice state.
		}

		switch(state)
		{
		case 0: // Going Forward
			delthaDist = _maxDelthaDist/4;
			delthaAngle = 0;
			break;
		case 1: // Going Backward
			delthaDist = -_maxDelthaDist/3;
			delthaAngle = 0;
			break;
		case 2: // Going Low to Left
			delthaDist = _maxDelthaDist/4;
			delthaAngle = _maxDelthaAngle/5;
			break;
		case 3: // Going to Left
			delthaDist = _maxDelthaDist/5;
			delthaAngle = _maxDelthaAngle/4;
			break;
		case 4: // Going to Left
			delthaDist = _maxDelthaDist/5;
			delthaAngle = _maxDelthaAngle/4;
			break;
		case 5: // Going to Very Left
			delthaDist = 0;
			delthaAngle = _maxDelthaAngle/3;
			break;
		case 6: // Going Low to Right
			delthaDist = _maxDelthaDist/4;
			delthaAngle = -_maxDelthaAngle/5;
			break;
		case 7: // Going to Right
			delthaDist = _maxDelthaDist/5;
			delthaAngle = -_maxDelthaAngle/4;
			break;
		case 8: // Going Very to Right
			delthaDist = 0;
			delthaAngle = -_maxDelthaAngle/3;
			break;
		case 9: // Stop
			delthaDist = 0;
			delthaAngle = 0;
			break;
		}

		--count;
		communic_SendDelthaDist(&delthaDist);
		communic_SendDelthaAngle(&delthaAngle);

		/* Delays to see the change of LED brightness. */
		vTaskDelayUntil(&xLastWakeTime, _xTestTaskPeriod);
	}
}
#endif //TEST_POSE_HAND

